import React from 'react';
import { Parallax, ParallaxLayer } from '@react-spring/parallax';
import styles from './mainMenu.module.css';

// Import the images
import backgroundImg from './background-image.jpg';
import midgroundImg from './midground-image.jpg';
import foregroundImg from './foreground-image.jpg';

function MainMenu() {
  return (
    <Parallax pages={2} style={{ top: '0', left: '0' }}>
      <ParallaxLayer offset={0} speed={0.2} style={{ backgroundImage: `url(${backgroundImg})`, backgroundSize: 'cover' }} />
      <ParallaxLayer offset={0.5} speed={0.5} style={{ backgroundImage: `url(${midgroundImg})`, backgroundSize: 'cover' }} />
      <ParallaxLayer offset={1} speed={0.8} style={{ backgroundImage: `url(${foregroundImg})`, backgroundSize: 'cover' }} />

      <ParallaxLayer offset={0} speed={0.1}>
        <header className={styles.header}>
          <h1 className={styles.title}>Senp<span id="highlight">ai</span> Suggests</h1>
          <nav className={styles.navOptions}>
            <a href="/likes" className={styles.navLink}>My Likes</a>
            <a href="/wishlist" className={styles.navLink}>My Wishlist</a>
            <a href="/feeling-lucky" className={styles.navLink}>I'm Feeling Lucky</a>
            <a href="/animelist" className={styles.navLink}>Search</a>
            <a href="/reco" className={styles.navLink}>Ask Senpai</a>
          </nav>
        </header>
      </ParallaxLayer>
    </Parallax>
  );
}

export default MainMenu;
